export const Footer = () => {
  return (
    <>
      <div className={s.bg}>
        <div className={s.width}>
          <div className={s.title}>Zapraszamy do kontaktu</div>
          <div className={s.phrase}>
            Usługi alpinistyczne to nasza praca ale również pasja.
          </div>
          <div className={s.phrase}>Bądźmy w kontakcie</div>
          <div className={s.flexik}>
            <div className={s.flexkolumn}>
              <p>Adres</p>
              <a href="https://maps.app.goo.gl/FwUAU8nGzqruFS3E9">
                Okocimska 3
              </a>
            </div>
            <div className={s.flexkolumn}>
              {" "}
              <p>Telefon</p>
              <a href="tel:+48514028592">514028592</a>
            </div>
            <div className={s.flexkolumn}>
              {" "}
              <p>E-mail</p>
              <a href="mailto:alpimix.kontakt@gmail.com">
                alpimix.kontakt@gmail.com
              </a>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
